import React, { useState } from 'react';
import { useForm } from "react-hook-form";
import Waypoint from '../Waypoint/Waypoint';
import GmapsService from '../../Services/gmaps-service';

import './App.css';

const App = () => {
  const [results, setResults] = useState('');

  const generateWaypoints = () => {
    const wps = [];

    for (let i = 1; i <= 6; i++) {
      wps.push(
        <Waypoint key={i} num={i} />
      );
    }

    return wps;
  };

  const onSubmitForm = (data) => {
    console.log(data);
    // setResults(data);
  };

  const { register, handleSubmit } = useForm();

  return (
    <div className="App">
      <header className="App-header">
        Route Finder
      </header>
      <main className="App-body">
        <form className="address-form" onSubmit={handleSubmit(onSubmitForm)}>
          <label htmlFor="officeField" />
          <input type="text" id="officeField" name="officeField" required ref={register} />
          <label htmlFor="addressField1" />
          <input type="text" name="addressField1" ref={register} />
          <input type="submit" value="Find" />
        </form>
        <ol className="results">
          {results}
        </ol>
      </main>
    </div>
  );
};

export default App;
